import React from "react";

const ParkInfo = () => {

  return (
    <div>

    {this.props.name && <p>Park Name: {this.props.name}</p>}

    {this.props.fullName && <p>Full Name:{this.props.fullName}</p>}

    {this.props.states && <p>State: {this.props.states}</p>}

    {this.props.designation && <p>Designation:{this.props.designation}</p>}

    {this.props.weatherInfo && <p>Weather: {this.props.weatherInfo}</p>}

    {this.props.latLong && <p>Coordinates: {this.props.latLong}</p>}

    {this.props.description && <p>Description: {this.props.description}</p>}
    {this.props.error && <p>{this.props.error}</p>}
    </div>
  );

}

export default ParkInfo;
